    maxsubarr = []
    maxsum = 1
    currentsum = 0
    i = 0
    for j in range(n):
        if a[j] >= 0:
            currentsum += a[j]
        if a[j] < 0 or j + 1 == n:
            if currentsum > maxsum:
                maxsum = currentsum
                if j + 1 != n:
                    maxsubarr = a[i:j]
                else:
                    maxsubarr = a[i:j + 1]
            elif currentsum == maxsum:
                if j - i + 1 > len(maxsubarr):
                    if j + 1 != n:
                        maxsubarr = a[i:j]
                    else:
                        maxsubarr = a[i:j + 1]
            currentsum = 0
            i = j + 1
    if not maxsubarr:
        return [-1]
    return maxsubarr

